import React from 'react'

function Nav() {
    return (
        <div className="nav">
            <img className ="nav_logo"  src ="https://www.google.com/url?sa=i&url=https%3A%2F%2Fcommons.wikimedia.org%2Fwiki%2FFile%3ALogonfx.png&psig=AOvVaw2H6sQFYjTQhPk3zD0xU5Se&ust=1625680223088000&source=images&cd=vfe&ved=0CAoQjRxqFwoTCPi5u_OAz_ECFQAAAAAdAAAAABAI" alt="Netflix Logo"
            />
        </div>
    )
}

export default Nav
